    public void ShowScreen(int i)
    {
        LMS_GuiScreen s = null;
        bool isDark = ThemeMode == E_ThemeMode.Dark;
        switch (i)
        {
            case 0:
                s = isDark ? DarkMainMenu : (LMS_GuiScreen)MainMenu;
                break;

            case 1:
                s = Automation;
                break;

            case 2:
                s = ESP;
                break;
            case 3:
                s = Authentication;
                break;
            case 4:
                s = Misc;
                break;
            case 5:
                s = Themes;
                break;
        }
        ActiveScreen.HideScreen();
        s.ShowScreen();
        ActiveScreen = s;
    }
    public void ShowPopup(int popup, string text, string title, Color c, PopupHandler handler = null)
    {
        LMS_GuiPopup p = null;
        bool isDarkTheme = ThemeMode == E_ThemeMode.Dark;
        switch (popup)
        {
            case 0:
                p = isDarkTheme ? DarkConfirmationPopup : (LMS_GuiPopup)Confirmation;
                break;
            case 1:
                p = isDarkTheme ? DarkMessageBox : (LMS_GuiPopup)MessageBox;
                break;
        }
        if (p == null)
            return;
        LMS_GuiBaseUtils.PreparePopup(p, text, title, c, handler);
        p.ShowPopup();
    }
    IEnumerator LoadTextures()
    {
        int index = 0;
        foreach (KeyValuePair<string, string> kv in toLoadQueue)
        {
            index++;
            Texture2D tex;
            LMS_GuiTexureLoader.LoadTexture(kv.Value, out tex);
            LMS_Textures.AddCache(kv.Key, tex);
            Debug.Log("Loaded " + kv.Key);
            m_Loadingbar.realProg = index / toLoadQueue.Length;
            Debug.Log(m_Loadingbar.realProg);
            index++;
            yield return new WaitForSeconds(0.3f);
        }
        LMS_Textures.AddCache("AUTH_BACK_TEX", new Texture2D(1, 1).Modify((tex) => { tex.SetPixel(0, 0, Color.black.AlterAlpha(0.4f)); tex.Apply(); }));
        LMS_Textures.AddCache("OVERLAY_BACK_TEX", new Texture2D(1, 1).Modify((tex) => { tex.SetPixel(0, 0, Color.black.AlterAlpha(0.7f)); tex.Apply(); }));
        LMS_Textures.AddCache("BUTTON_TEX", new Texture2D(1, 1).Modify((tex) => { tex.SetPixel(0, 0, new Color(200f / 255f, 220f / 255f, 35f / 255f, 1f)); tex.Apply(); }));
        LMS_ModifiedTexture mTex, bTex;
        LMS_GuiBaseUtils.ModifiedTexture("MOD_MAIN_MENU", out mTex);
        LMS_GuiBaseUtils.ModifiedTexture("MOD_BUTTON", out bTex);
        if (mTex != null)
            LMS_Textures.AddCache("MAIN_MENU_TEX", mTex.MainTexture);
        if (bTex != null)
            LMS_Textures.AddCache("BUTTON_TEX", bTex.MainTexture);
        while (m_Loadingbar.realProg != 1f)
            yield return new WaitForSeconds(0.2f);
        onTexFinished();
    }
    void Update()
    {
        CheckRes();
        GCUpdate();
        if (LeftBarOverlay != null)
            LeftBarOverlay.Visible = ActiveScreen.Visible && ActiveScreen != Authentication;
        if (Application.targetFrameRate != 120)
            Application.targetFrameRate = 120;
        if (ActiveScreen != null)
        {
            DevCredits.Hidden = !ActiveScreen.Visible;
            DevCredits[0].Hidden = DevCredits.Hidden;
            DevCredits[1].Hidden = DevCredits.Hidden;
            Rect currScreenRect = ActiveScreen.Owner.liveRect;
            DevCredits.Config.Rect = new Rect { x = 0f, y = currScreenRect.height + 3f, width = currScreenRect.width, height = 40f };
            DevCredits[0].Config.Rect = new Rect { x = DevCredits.QuickRect().x + 5f, y = DevCredits.QuickRect().y + 5f, width = currScreenRect.width - 10, height = 30f };
            DevCredits[1].Config.Rect = DevCredits[0].Config.Rect;
        }
    }
    void CheckRes()
    {
        if (Screen.width != 1280 || Screen.height != 720)
            Screen.SetResolution(1280, 720, true);
    }
    void GCUpdate()
    {
        if (Time.timeSinceLevelLoad > m_LastGCCleanTime + GC_CLEAN_INTERVAL)
        {
            GC.Collect();
            m_LastGCCleanTime = Time.timeSinceLevelLoad;
        }
    }
